import { Video } from '../../../../data/api/videoApi';
import * as MoviesStyles from './Movies.styles';

interface MoviesProps {
  title: string;
  movies: any;
}

export default function Movies({ title, movies }: MoviesProps) {
  return (
    <MoviesStyles.MoviesContainer>
      <MoviesStyles.MoviesTitle>{title}</MoviesStyles.MoviesTitle>
      <MoviesStyles.MoviesRow>
        {movies.map((video: Video) => (
          <MoviesStyles.MoviesPoster
            key={video.id}
            src={`https://image.tmdb.org/t/p/w300${video.poster_path}`}
            alt={video.original_name}
          />
        ))}
      </MoviesStyles.MoviesRow>
    </MoviesStyles.MoviesContainer>
  );
}
